## Proposed changes

refactor inverted index interface in  tablet schema

1. There's a large amount of similar code
```
for (const auto& index : schema_ptr->indexes()) {
    if (index.index_type() == IndexType::INVERTED) {
         ....
    }
}
```
Now it has been changed to

```
for (const auto& index : schema_ptr->inverted_indexes()) {
      ....
}
```

2. Remove functions with redundant functionality, such as `get_indexes_for_column `, `get_inverted_index_with_index_id` ....

3.  Retrieve the index meta for the inverted index. Currently, there are two types: one is `inverted_index(TabletColumn)`, which checks the column type (e.g., if the column type is float, it does not support indexing and will be filtered out); the other is `inverted_index(unique_id, index_suffix)`, which retrieves the index meta for the current column without checking the column type.




